define({"topics" : [{"title":"Add a Time Condition","shortdesc":"\n                  <p class=\"shortdesc\">A Time Condition defines periods of time that can be applied to outbound routes or         inbound routes.</p>\n               ","id":"task_bpz_nb2_2db","href":"topic\/add_a_time_condition.html","menu": {"hasChildren":false,},"tocID":"task_bpz_nb2_2db-d46e9991","topics":[]},{"title":"Add a Holiday","shortdesc":"\n                  <p class=\"shortdesc\">You can add a group of holidays and set a Time Condition destination for the holidays         on your inbound route. When\n                     a customer calls to your company during holidays, the PBX will         route the call to the pre-configured destination.\n                  </p>\n               ","id":"task_my2_bk2_2db","href":"topic\/add_a_holiday.html","menu": {"hasChildren":false,},"tocID":"task_my2_bk2_2db-d46e10064","topics":[]},{"title":"Time Condition Examples","id":"topic_yzk_f42_2db","href":"topic\/time_condition_examples.html","menu": {"hasChildren":false,},"tocID":"topic_yzk_f42_2db-d46e10137","topics":[]},{"title":"Time Condition Override","shortdesc":"\n                  <p class=\"shortdesc\">The Time Condition Override function is used to switch the incoming call routing     against the Time Condition. An authorised\n                     user can dial Time Condition feature code to override     the time condition.\n                  </p>\n               ","id":"topic_oyj_mcm_2db","href":"topic\/time_condition_override.html","menu": {"hasChildren":false,},"tocID":"topic_oyj_mcm_2db-d46e10207","topics":[]},{"title":"Monitor Time Condition State","shortdesc":"\n                  <p class=\"shortdesc\">You can set a BLF key on your phone to quickly override time condition and monitor         the time condition state.</p>\n               ","id":"task_t51_jdc_pdb","href":"topic\/monitor_time_condition_state.html","menu": {"hasChildren":false,},"tocID":"task_t51_jdc_pdb-d46e10280","topics":[]}]});